SELECT 
    -- sscfc_admon_general
    ag.id_admon_general AS "Id",
    ag.administracion AS "Administración",
    ag.acronimo AS "Acrónimo",
    ag.puesto AS "Puesto",
    ag.fecha_creacion AS "Fecha de creación",
    ag.fecha_modificacion AS "Última modificación",
    ag.estatus AS "Estatus",
    
    -- sscfc_administrador_general
    adm_g.id_administrador_general AS "Id_Administrador_General",
    adm_g.administrador AS "Administrador general",
    adm_g.correo AS "Correo_Administrador_General",
    adm_g.telefono AS "Telefono_Administrador_General",
    adm_g.fecha_inicio_vigencia AS "Inicio_Vigencia_Admin_General",
    adm_g.fecha_fin_vigencia AS "Fin_Vigencia_Admin_General",
    adm_g.estatus AS "Estatus_Administrador_General",
    
    -- sscfc_admon_central
    ac.id_admon_central AS "Id_Central",
    ac.administracion AS "Administración_Central",
    ac.acronimo AS "Acrónimo_Central",
    ac.puesto AS "Puesto_Central",
    ac.fecha_creacion AS "Fecha_Creacion_Central",
    ac.fecha_modificacion AS "Ultima_Modificacion_Central",
    ac.estatus AS "Estatus_Central",
    
    -- sscfc_administrador_central
    adm_c.id_administrador_central AS "Id_Administrador_Central",
    adm_c.administrador AS "Administrador central",
    adm_c.correo AS "Correo_Administrador_Central",
    adm_c.telefono AS "Telefono_Administrador_Central",
    adm_c.fecha_inicio_vigencia AS "Inicio_Vigencia_Admin_Central",
    adm_c.fecha_fin_vigencia AS "Fin_Vigencia_Admin_Central",
    adm_c.estatus AS "Estatus_Administrador_Central",
    
    -- sscfc_administracion
    a.id_administracion AS "Id_Administracion",
    a.administracion AS "Área",
    a.acronimo AS "Acrónimo_Area",
    a.puesto AS "Puesto_Area",
    a.fecha_creacion AS "Fecha_Creacion_Area",
    a.fecha_modificacion AS "Ultima_Modificacion_Area",
    a.estatus AS "Estatus_Area",
    
    -- sscfc_administrador_administracion
    adm_a.id_administrador_administracion AS "Id_Administrador_Area",
    adm_a.administrador AS "Administrador de área",
    adm_a.correo AS "Correo_Administrador_Area",
    adm_a.telefono AS "Telefono_Administrador_Area",
    adm_a.fecha_inicio_vigencia AS "Inicio_Vigencia_Admin_Area",
    adm_a.fecha_fin_vigencia AS "Fin_Vigencia_Admin_Area",
    adm_a.estatus AS "Estatus_Administrador_Area",
    
    -- sscfc_empleado_administracion
    emp_a.id_empleado_administracion AS "Id_Empleado",
    emp_a.nombre AS "Nombre",
    emp_a.correo AS "Correo electrónico",
    emp_a.telefono AS "Teléfono",
    emp_a.fecha_inicio_vigencia AS "Inicio Vigencia",
    emp_a.fecha_fin_vigencia AS "Fin Vigencia",
    emp_a.fecha_creacion AS "Fecha de creación_Empleado",
    emp_a.fecha_modificacion AS "Última modificación_Empleado",
    emp_a.estatus AS "Estatus_Empleado",
    emp_a.id_tipo_empleado AS "Tipo_Empleado"

FROM 
    sisecofi.sscfc_admon_general ag
    
    LEFT JOIN sisecofi.sscfc_administrador_general adm_g
        ON ag.id_admon_general = adm_g.id_admon_general
    
    LEFT JOIN sisecofi.sscfc_admon_central ac
        ON ag.id_admon_general = ac.id_admon_general
    
    LEFT JOIN sisecofi.sscfc_administrador_central adm_c
        ON ac.id_admon_central = adm_c.id_admon_central
    
    LEFT JOIN sisecofi.sscfc_administracion a
        ON ac.id_admon_central = a.id_admon_central
    
    LEFT JOIN sisecofi.sscfc_administrador_administracion adm_a
        ON a.id_administracion = adm_a.id_administracion
    
    LEFT JOIN sisecofi.sscfc_empleado_administracion emp_a
        ON a.id_administracion = emp_a.id_administracion

WHERE 
    -- sscfc_admon_general
    ag.acronimo = 'AGCTI'
    AND ag.estatus = true
    -- sscfc_administrador_general
    AND adm_g.estatus = true
    -- sscfc_admon_central
    AND ac.acronimo = 'ACPPI'
    AND ac.estatus = true
    -- sscfc_administrador_central
    AND adm_c.estatus = true
	-- sscfc_administracion
    AND a.acronimo = 'API'
    AND a.estatus = true
	-- sscfc_administrador_administracion
    AND adm_a.estatus = true
	-- sscfc_empleado_administracion
    AND emp_a.estatus = true

ORDER BY emp_a.nombre;



